import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"

function App() {
  return (
    <div className="App" style={{backgroundImage: bg, backgroundSize: "cover", minHeight: "100vh" }}>
      <div className="header" style={{display: 'flex', flexDirection: "row"}}>
        <div className="Title" style={{flexDirection: "row"}}>

        </div>
        <img src={logo} />
      </div>
    </div>
  );
}

export default App;
